import UserPerformanceData from '../core/UserPerformanceData'

export default class UserPerformanceMapper {
    static convertToUserPerf(json) {
        return new UserPerformanceData(json.userId, {
            cardio: json.data[0].value,
            energy: json.data[1].value,
            endurance: json.data[2].value,
        })
    }
}

const cardio = userPerformanceData.performanceData[0].value
const energy = userPerformanceData.performanceData[1].value
const endurance = userPerformanceData.performanceData[2].value
const strength = userPerformanceData.performanceData[3].value
const speed = userPerformanceData.performanceData[4].value
const intensity = userPerformanceData.performanceData[5].value
